import { Injectable } from '@angular/core';
import { Menu } from '../../models/menu';
import { Observable, of } from 'rxjs';
import { delay } from 'rxjs/operators'
import { environment } from 'src/environments/environment';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})

export class MenuService {
  url: string = `${environment.HOST_URL}/menus`;  
  constructor(private http: HttpClient) { }
  
  listar() {
    return this.http.get<Menu[]>(this.url);
  }

  registrar(data: Menu) {
    return this.http.post(this.url, data);
  }

  modificar(data: Menu) {
    return this.http.put(this.url, data);
  }

  eliminar(id: number) {
    return this.http.delete(`${this.url}/${id}`);
  }

  getMenus(term: string = null): Observable<Menu[]> {
    let items = getlistaMenu();
    if (term) {
        items = items.filter(x => (x.mennom.toLocaleLowerCase().indexOf(term.toLocaleLowerCase()) > -1) ||
                                  (x.sistema.sisnom.toLocaleLowerCase().indexOf(term.toLocaleLowerCase()) > -1));
    }
    return of(items).pipe(delay(500));
  }

  getMenusxSiscod(term: number = 0): Observable<Menu[]> {
    let items = getlistaMenu();
    if (items) {
        items = items.filter(x => (x.sistema.siscod == term));
    }
    return of(items).pipe(delay(500));
  }
}

